cac:PresentationPeriod.cbc:Description:
Dlais de recours prcontractuel : possibilit de l'introduire entre le dbut de la procdure de passation et la signature du march et dans les quelques jours suivant la date de notification de la dcision de rejet de la candidature ou de l'offre ;
Dlai applicable en cas de demande d'annulation d'un acte dtachable du contrat : 2 mois  compter de la publication, de l'affichage ou de la notification de l'acte attaqu (articles L 521-1 et R 421-1 du Code de justice administrative) ;
Dlai applicable pour un candidat non retenu en cas de demande d'annulation du march lui-mme : 2 mois  compter de la publication ou de l'affichage de l'avis de signature de ce march

